  `;constructor(){super(),this.nextWord();let t=null;this.addEventListener("click",(async()=>{if(null!==this.word)try{t=this.word;await playKorean(this.word);t===this.word&&(this.played=!0)}catch(t){this.toast("Sorry, this sound is not available"),this.played=!0}}))}render(){return H`
